import "@openzeppelin/contracts/access/Ownable.sol";
import "./uniswapv2/interfaces/IUniswapV2Factory.sol"; // interface factorys
import "./uniswapv2/interfaces/IUniswapV2Router02.sol"; // interface factorys
import "./uniswapv2/interfaces/IUniswapV2Pair.sol";

import "./ApexToken.sol";

contract ExchangeConnector is Ownable {

    ApexToken public apex;

    IUniswapV2Router02 public uniswapRouterV2;
    IUniswapV2Factory public uniswapFactory;
    IUniswapV2Pair public pair;
    address public tokenUniswapPair;

    constructor(
        ApexToken _apex,
        address router,
        address factory
    ) public {
        apex = _apex;
        initialSetup(router, factory);
    }

    function initialSetup(address router, address factory) internal {
        uniswapRouterV2 = IUniswapV2Router02(router != address(0) ? router : 0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D); // For testing
        uniswapFactory = IUniswapV2Factory(factory != address(0) ? factory : 0x5C69bEe701ef814a2B6a3EDD4B1652CB9cc5aA6f); // For testing
        createUniswapPairMainnet();
    }

    function createUniswapPairMainnet() internal {
        require(tokenUniswapPair == address(0), "Token: pool already created");
        tokenUniswapPair = uniswapFactory.createPair(
            address(uniswapRouterV2.WETH()),
            address(apex)
        );
        pair = IUniswapV2Pair(tokenUniswapPair);
    }

    function updateExchange(address router, address factory) public onlyOwner {
        uniswapRouterV2 = IUniswapV2Router02(router);
        uniswapFactory = IUniswapV2Factory(factory);
        createUniswapPairMainnet();
    }

    function getPathForETHToApex() public view returns (address[] memory) {
        address[] memory path = new address[](2);
        path[0] = uniswapRouterV2.WETH();
        path[1] = address(apex);

        return path;
    }
}
